import Vue from 'vue/dist/vue.js'
import Router from 'vue-router'//使用 路由

Vue.use(Router);

const routes = [
    {
        path: '/status',
        name: 'status',
        component: resolve => require(['../index/status/Status'], resolve)
    },
    {
        path: '/problems',
        name: 'problems',
        component: resolve => require(['../index/problem/ProblemList'], resolve)
    },
    {
        path: '/home',
        name: 'home',
        meta: {title: 'Home'},
        component: resolve => require(['../index/Home'], resolve)
    },
    {
        path: '/problem/:problem_id',
        name: 'problem',
        component: resolve => require(['../index/problem/Problem'], resolve)
    },
]

const router = new Router({
    mode: "history",
    routes,
});

router.beforeEach((to, from, next) => {
    next();
});
